svg.script:
    frame = 130;

    function doOneStep() {
	ciel = document.getElementById("ciel");
	ciel.setAttribute("opacity", (100-frame)/100);
        sol = document.getElementById("sol");
	sol.setAttribute("opacity", (100-frame)/100);
        monstre = document.getElementById("monstre");
	monstre.setAttribute("opacity", (100-frame)/100);

        if (frame-- >= 0){
            setTimeout(doOneStep,25);
        }
    }
    doOneStep();
